class Solution {

    /**
     * @param Integer $purchaseAmount
     * @return Integer
     */
    function accountBalanceAfterPurchase($purchaseAmount) {
        // Finding the remainder when divided by 10
        $remainder = $purchaseAmount % 10;

        // Rounding logic
        if ($remainder == 0) {
            $roundedAmount = $purchaseAmount; // No rounding needed if it's already a multiple of 10
        } elseif ($remainder <= 5) {
            // Round down if the remainder is less than or equal to 5
            $roundedAmount = $purchaseAmount - $remainder;
        } else {
            // Round up if the remainder is greater than 5
            $roundedAmount = $purchaseAmount + (10 - $remainder);
        }

        // Calculate the new balance after the purchase
        $newBalance = 100 - $roundedAmount;

        return $newBalance;
    }
}
